import Hello from './Hello';
import {useState} from 'react';

function App() {
  const [counter, setCounter ] = useState(15)

  const addValue = () => {
    setCounter(counter + 1);
    console.log(counter);
  }

  return (
    <>
      <h1 className="title">Counter value: {counter}</h1>

      <button
        onClick = {addValue}>
        Add value  </button>

      <br/>

      <button> Subtract value </button>
    </>
  );
}

export default App;
